import React, {Component} from 'react';
import "../style/css-final.css";
import "../style/bootstrap.min.css";
import { Link } from "react-router-dom";
import Search from './search';

class Header extends Component{
    postSignout = () => {
        localStorage.removeItem("is_login");
        // localStorage.clear()
        this.props.history.push("/");
    };
    render(){
        return(
            <header>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-2 logo">
                         <img src={require("../img/logo512.png")} alt=""/>
                         <p>KabarKabar</p>
                    </div>
                    <div className="col-md-4">
                         <ul>
                             <li><Link to = "/news">News</Link></li>
                             <li><Link to = "/ekonomi">Ekonomi</Link></li>
                             <li><Link to = "/politik">Politik</Link></li>
                             <li><Link to = "/new">Hiburan</Link></li>
                             <li><Link to = "/new">Lainnya</Link></li>
                         </ul>
                     </div>
                     <div className="col-md-4 searching">
                         <Search {...this.props}/>
                     </div>
                     <div className="col-md-2 akun">
                         <ul>
                             <li><Link to = "/signin">Masuk</Link></li>
                             <li><Link onClick={this.postSignout}>Keluar</Link></li>
                         </ul>
                     </div>
                </div>
            </div>
         </header>
        );
    }
}

export default Header;
